import BoxRHS from "./Main/BoxRHS";
import PatientReg from "./Main/Login_Reg/PatientReg";
import {Routes, Route} from "react-router-dom";
import DoctorLogin from "./Main/Login_Reg/DoctorLogin";
import PatientLogin from "./Main/Login_Reg/PatientLogin";
import DoctorReg from "./Main/Login_Reg/DoctorReg";
import AfterLogin from "./Main/Login_Reg/AfterLogin/AfterLogin"
import "./Main.css";
import AfterPatientLoginBlock from "./Main/Login_Reg/AfterLogin/AfterPatientLogin/AfterPatientLoginBlock";


const LoginOrNot = () => {
    const isPatLog = localStorage.getItem("Patient Log");
    
    if (isPatLog === "true") {
        return (
            <div>
                
            </div>
        );
    } else {
        return (
            <div>
                <Routes>
                    <Route path="*"
                        element={<BoxRHS/>}>
                        <Route path="doctorlogin"
                            element={<DoctorLogin/>}/>
                        <Route path="patientlogin"
                            element={<PatientLogin/>}/>
                    </Route>
                    <Route>
                        <Route path="patientRegistration"
                            element={<PatientReg/>}/>
                        <Route path="doctorRegistration"
                            element={<DoctorReg/>}/>
                    </Route>

                    <Route path="admin"
                        element={<AfterLogin/>}/>
                </Routes>
            </div>
        );
    }
}


const Main = () => {
    return(
      <>
      <LoginOrNot/>
      </>
    );
}


export default Main;
